import { useEffect, useState } from 'react';
import UserInfoModalWindow from '../../components/UserInfoModalWindow/UserInfoModalWindow';
import { useRedirectDevs } from '../../hooks/useRedirectHook';
import LogsListSection from './LogsListSection/LogsListSection';
import UserInfoContainer from '../../components/UserInfoContainer/UserInfoContainer';
import { useSelector } from 'react-redux';
import { interfaceSlice } from '../../store/interfaceSlice';
import { intarfaceSelector } from '../../selectors/interfaceSelectors';

const LogsPage = () => {
	let { statusDev } = useRedirectDevs(true);

	let userSeenNews = useSelector(intarfaceSelector.userInformationModalWindowStatus);

	useEffect(() => {
		console.log(userSeenNews);
	}, []);

	return (
		<>
			{statusDev && (
				<div>
					<h1>Журнал запитів</h1>

					<div className="row">
						<UserInfoContainer id={'dba91e41-d7cf-4b9e-bcc8-b1202822bbb7'}>
							<p>Onclick</p>
						</UserInfoContainer>
						{/* <button onClick={visibleButtonOnClickHandler}>onClick</button>
						{visibleStatus && (
							<UserInfoModalWindow
								closeModal={visibleButtonOnClickHandler}
								visibleStatus={visibleStatus}
								userId={'dba91e41-d7cf-4b9e-bcc8-b1202822bbb7'}
							/>
						)} */}
					</div>

					<div className="row">
						<LogsListSection />
					</div>
				</div>
			)}
		</>
	);
};

export default LogsPage;
